import { useState } from "react"
import { useNavigate } from "react-router-dom";

const Otp=()=>{
    const [otp_number, otpUpdate] = useState('');
    const navigate = useNavigate();

    const otpVerification = async(e)=>{
        e.preventDefault();
        let inputObj = {"otp_number":otp_number}
        const fetchapi = await fetch('http://localhost:1731/user/verify-otp',{
            method:'POST',
            headers:{'content-type':'application/json'},
            body:JSON.stringify(inputObj)
        });
        if(fetchapi.status === 200){
            if(sessionStorage.isOrgId == false){
                navigate('/org');
            }else{
                navigate('/dashboard');
            }
        }
    }
    return(
        <div>
            <form onSubmit={otpVerification}>
                <input type="number" value={otp_number} onChange={(e)=>otpUpdate(e.target.value)}></input>
                <input type="submit"></input>
            </form>
        </div>
    );
}

export default Otp;
